If it is helpful to anyone: 

google_to_sf &lt;- function(x) {
  x_sf &lt;- x |&gt;
    rev() |&gt;
    sf::st_point() |&gt;
    sf::st_sfc(crs = 4326) |&gt;
    sf::st_sf() 

  sf::st_geometry(x_sf) &lt;- "geometry"

  x_sf
}

